ControlPropertyState.AutoRuleBindingString:
If(
    IsBlank(inpCPF_Busca_Mascara_2.Text),
    Notify("Selecione um Plantão e um CPF para começar o Atendimento", NotificationType.Information),
    Set(varCadastroPessoa, First(Filter(dbCadastroBeneficiario, CPF = inpCPF_Busca_Mascara_2.Text)));
    Set(varCadastroPesquisa, LookUp(dbPesquisaSocioEconomica, CPF = varCadastroPessoa.CPF));
    Navigate('Pesquisa Screen', Transition.Push)
);
